var body = mount(<Body api="http://3.18.110.2:3001/api" />);

function pages(data, pageSize, pageNum){
    var out = [];
    var start = (pageSize*(pageNum-1));
    for(var i=start; i<start+pageSize && i <data.length; i++){
        out.push(data[i]);
    }
    return out;
}

describe('App.js Test Case 02', () => {

    it('Test API is http://3.18.110.2:3001/api', () => {
        expect(body.props().api).toEqual("http://3.18.110.2:3001/api");
    });

    it('Test setting up pages works', () => {
        body.setState({data: books});
        body.instance().search("title", "");
        expect(body.state().display).toEqual(books);
        expect(body.state().pages).toEqual(pages(books, 8, 1));
    });

    it('Test Pages cases one: Next', () => {
        body.instance().pageButton(books,8);
        expect(body.state().pages).toEqual(pages(books, 8, 2));
    });

    it('Test Pages cases one: Previous', () => {
        body.instance().pageButton(books,-8);
        expect(body.state().pages).toEqual(pages(books, 8, 1));
    });
});